import React from "react";

export default function Card({ max, min, name, img, onClose }) {
  // ac치 va tu c칩digo
  function handleOnClose() {
    if (typeof onClose === "function") onClose();
  }
  return (
    <div>
      <button onCLick={handleOnClose}>X</button>
      <span>{name}</span>
      <div>
        <label>Min</label>
        <span>{min}</span>
      </div>
      <div>
        <label>Max</label>
        <span>{max}</span>
      </div>
      <img src={img} alt="weather" />
    </div>
  );
}
